  return (
      <section>
          <div>
              <h6>Peter Awotola</h6>
              <h1>Frontend Developer<span>.</span> </h1>
              <p>I love to build products for the web.</p>
              <div>
                  <p>Highly skilled at building fast, high performant products </p>
              </div>
          </div>
          <div></div>
    </section>
  );
};

export default Hero;
